import '../stylesheets/App.css';
import data from '../data/data.json';

const App = () => {

	const podium = data.filter(
    (winner) => {
		  // eslint-disable-next-line no-unused-expressions
		  winner.time <= 35;
    }
  );

	return console.log(podium);
};

export default App;
